import React from 'react';
import ReactTerminal from 'react-terminal-component';

function Terminal() {
    return (
        <div className='Terminal'>
            <ReactTerminal theme={{
                background: '#141313',
                promptSymbolColor: '#6effe6',
                commandColor: '#fcfcfc',
                outputColor: '#fcfcfc',
                errorOutputColor: '#ff89bd',
                fontSize: '1.1rem',
                spacing: '1%',
                fontFamily: 'monospace',
                width: '100',
                height: '50vh'
            }}/>
        </div>
    );
}

export default Terminal;
